      "content": "// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.13;

import "hardhat/console.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/common/ERC2981.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "./IERC5643.sol";

contract NiftyBridge721NftCollection is IERC5643, ERC721, ERC2981, Ownable {
    using Counters for Counters.Counter;

    string _contractUri;
    string _baseUri;
    address private _manager;
    mapping(uint256 => address) public creators;
    mapping(uint256 => string) private _tokenURIs;
    mapping(uint256 => uint64) private _expirations;
    Counters.Counter private _tokenIds;
    string _metadataSrc;

    constructor(
        string memory contractUri,
        string memory baseUri,
        address manager,
        address royaltyRecipient,
        uint96 royaltyValue,
        string memory metadataSrcIn
    ) ERC721("NiftyBridge721NftCollection", "NB") {
        _metadataSrc = metadataSrcIn;
        _contractUri = contractUri;
        _baseUri = baseUri;
        _manager = manager;

        if (royaltyValue > 0) {
            _setDefaultRoyalty(royaltyRecipient, royaltyValue);
        }
    }

    modifier ownerOrManager() {
        require(isOwner() || isManager());
        _;
    }

    modifier creatorOnly(uint256 _id) {
        require(creators[_id] == msg.sender);
        _;
    }

    function isOwner() public view returns (bool) {
        return _msgSender() == owner();
    }

    function isManager() public view returns (bool) {
        return _msgSender() == _manager && _manager != address(0);
    }

    function supportsInterface(
        bytes4 _interfaceId
    ) public view override(ERC721, ERC2981) returns (bool) {
        return super.supportsInterface(_interfaceId);
    }

    function airdropMultiple(
        address _from,
        uint256[] calldata _ids,
        address[] calldata _to
    ) external {
        require(
            _from == msg.sender || isApprovedForAll(_from, msg.sender) == true,
            "Need operator approval for 3rd party transfers."
        );

        for (uint256 i = 0; i < _to.length; ++i) {
            address to = _to[i];
            uint256 id = _ids[i];
            _transfer(_from, to, id);
        }
    }

    function mint(
        string calldata _uri,
        uint64 duration
    ) external ownerOrManager returns (uint256 _id) {
        _tokenIds.increment();
        _id = _tokenIds.current();
        creators[_id] = msg.sender;

        _mint(msg.sender, _id);
        if (bytes(_uri).length > 0) {
            setTokenURI(_uri, _id);
        }

        if (duration > 0) {
            _setSubscription(_id, duration);
        }
    }

    function mintToAddress(
        address to,
        string calldata _uri,
        uint64 duration
    ) external ownerOrManager returns (uint256 _id) {
        _tokenIds.increment();
        _id = _tokenIds.current();
        creators[_id] = msg.sender;

        _mint(to, _id);
        if (bytes(_uri).length > 0) {
            setTokenURI(_uri, _id);
        }

        if (duration > 0) {
            _setSubscription(_id, duration);
        }
    }

    function createBulk(
        uint256 _tokensCount
    ) external ownerOrManager returns (uint256 firstTokenId) {
        firstTokenId = _tokenIds.current() + 1;
        for (uint256 i = 0; i < _tokensCount; ++i) {
            _tokenIds.increment();
            uint256 _id = _tokenIds.current();
            _mint(msg.sender, _id);
            creators[_id] = msg.sender;
        }
    }

    function renewSubscription(
        uint256 tokenId,
        uint64 duration
    ) public payable {
        require(
            isManager() || isOwner() || _isApprovedOrOwner(msg.sender, tokenId),
            "Caller is not owner nor approved nor manager"
        );

        uint64 currentExpiration = _expirations[tokenId];
        uint64 newExpiration;
        if (currentExpiration == 0) {
            newExpiration = uint64(block.timestamp) + duration;
        } else {
            if (!isRenewable(tokenId)) {
                revert("Subscription not renewable");
            }
            newExpiration = currentExpiration + duration;
        }

        _expirations[tokenId] = newExpiration;

        emit SubscriptionUpdate(tokenId, newExpiration);
    }

    function _setSubscription(uint256 tokenId, uint64 duration) internal {
        uint64 newExpiration = uint64(block.timestamp) + duration;
        _expirations[tokenId] = newExpiration;
        emit SubscriptionUpdate(tokenId, newExpiration);
    }

    function cancelSubscription(uint256 tokenId) external payable {
        require(
            isManager() || isOwner() || _isApprovedOrOwner(msg.sender, tokenId),
            "Caller is not owner nor approved nor manager"
        );
        delete _expirations[tokenId];
        emit SubscriptionUpdate(tokenId, 0);
    }

    function setContractURI(string calldata _uri) external ownerOrManager {
        _contractUri = _uri;
    }

    function setBaseURI(string calldata _uri) external ownerOrManager {
        _baseUri = _uri;
    }

    function setTokenURI(
        string calldata _uri,
        uint256 _id
    ) private creatorOnly(_id) {
        require(_exists(_id), "ERC721URIStorage: URI set of nonexistent token");
        _tokenURIs[_id] = _uri;
    }

    function setMetadataSrc(string calldata _uri) external ownerOrManager {
        _metadataSrc = _uri;
    }

    function setManager(address manager) external onlyOwner {
        _manager = manager;
    }

    function toString(uint256 value) private pure returns (string memory) {
        if (value == 0) {
            return "0";
        }
        uint256 temp = value;
        uint256 digits;
        while (temp != 0) {
            digits++;
            temp /= 10;
        }
        bytes memory buffer = new bytes(digits);
        while (value != 0) {
            digits -= 1;
            buffer[digits] = bytes1(uint8(48 + uint256(value % 10)));
            value /= 10;
        }
        return string(buffer);
    }

    function tokensCount() public view returns (uint256) {
        return _tokenIds.current();
    }

    function expiresAt(uint256 tokenId) external view returns (uint64) {
        return _expirations[tokenId];
    }

    function isRenewable(uint256 /* tokenId */) public pure returns (bool) {
        return true;
    }

    function contractURI() public view returns (string memory) {
        return _contractUri;
    }

    function baseURI() public view returns (string memory) {
        return _baseUri;
    }

    function tokenURI(
        uint256 _id
    ) public view override returns (string memory) {
        if (bytes(_tokenURIs[_id]).length > 0) {
            return _tokenURIs[_id];
        } else {
            return string(abi.encodePacked(_baseUri, toString(_id)));
        }
    }

    function metadataSrc() public view returns (string memory) {
        return _metadataSrc;
    }
}
